                                       sum += num % 10;
                                       num /= 10;
                               }

                               if (sum >= a && sum <= b ) {
                                       answer = answer + i;
                               }
                       }
                       System.out.println(answer);
               } catch (Exception e) {
                       e.printStackTrace();
               }
       }

}

